import React, { Component, useEffect, useState } from 'react'
import axios from "axios"
import { render } from '@testing-library/react';
export default class EmployeeLaw extends Component {
    constructor(){
        super();
        this.state={
            Myarray:[]
        };
    }

    componentDidMount(){
        axios.get("api/serv")
        .then(result=> {
            const Myarray = result.data;
            this.setState({Myarray});
        });
    }
    deleteSerice1(id){
        console.log()
        axios.delete(`api/serv/delete/${id}`)
        .then(resul=>{
            const Myarray =this.state.Myarray.filter
            (HearingImpaireds => HearingImpaireds.id !== id);
            this.setState({Myarray});
        })
    }
    render(){
    return (
        <div>
            <h1> List Of Cars : </h1>
            <hr />
            {this.state.Myarray.map(HearingImpaireds => {
                return <div key={HearingImpaireds.id}>
                     <h2>{HearingImpaireds.servicetype}</h2>
                    <h2>{HearingImpaireds.adtex}</h2>
                    <p>{HearingImpaireds.appointment}</p>
                    <button onClick={(e)=> this.deleteSerice1(HearingImpaireds.id.e)}>delete</button>
                    <hr/>
                </div>
            })}
        </div>
    )
}
}
